import React from "react";
import BlogCard from "./BlogCard";
export default function BlogCradList({ data }) {
  console.log(data[0].data.image.url);
  return (
    <>
      {data.map((d) => (
        <BlogCard img={d.data.image.url} />
      ))}
    </>
  );
}
